"""To **analyze** the data, I concentrated on the wavelength range from **1545 to 1555 nm**. The **expected resonant frequencies** of the **principal resonator** were calculated using the formula: $λ^2/n_{g}L$, where λ is set to 1550 nm, $n_{g}$ is 2, and L is 2πR. The radius of the principal ring is 114 μm, and the radius of the auxiliary ring is $0.75*R$.
Thus, the **$FSR_{prin}$** is **1.67 nm** and the **$FSR_{aux}$** is **2.23 nm**. The **goal** for the following calculation is to automatically find the **Q-factor** for each element by extracting the **FWHM** by detecting each peak and finding the width at **1/e (≈ 37%)** of the base power. From FWHM, we can calculate **Q** as **$\nu_{0}/δν$**, where $\nu_{0}$ is the resonance frequency, and the full width at half maximum bandwidth of the resonator is δν. The **blue dashed line** reperesents the **$FSR_{aux}$**, and the **red dashed line** depicts the **$FSR_{prin}$**.
"""

import numpy as np
import matplotlib.pyplot as plt
from scipy.signal import argrelextrema
import os
from scipy.io import loadmat
directory = '/content/'
plot_width = 10
plot_height = 6
plt.figure(figsize=(plot_width, plot_height))
for filename in os.listdir(directory):
    if filename.endswith(".mat"):
        plot_id = filename.split('_')[-1].split('.')[0]
        mat_data = loadmat(os.path.join(directory, filename))
        scandata = mat_data['scandata']
        wl = scandata['Wavelength (nm)'][0][0]
        pw = scandata['Power (dBm)'][0][0][:, 1]
        wavelength = np.array(wl).flatten()
        power_data = np.array(pw)
        mask = (wavelength >= 1545) & (wavelength <= 1555)
        filtered_wavelength = wavelength[mask]
        filtered_power_data = power_data[mask]
        filtered_power_data_linear = 10 ** (filtered_power_data / 10)
        ng_principal = 2
        R_principal = 114000  # nm
        L_principal = 2 * np.pi * R_principal
        lmda = 1550  # nm
        FSR_principal = lmda ** 2 / (ng_principal * L_principal)
        ng_secondary = 2
        R_secondary = 0.75*114000  # nm
        L_secondary = 2 * np.pi * R_secondary
        FSR_secondary = lmda ** 2 / (ng_secondary * L_secondary)
        num_peaks = 5
        center_peak = lmda
        peaks_principal = np.linspace(center_peak - (FSR_principal * (num_peaks - 1) / 2), center_peak + (FSR_principal * (num_peaks - 1) / 2), num_peaks)
        peaks_secondary = np.linspace(center_peak - (FSR_secondary * (num_peaks - 1) / 2), center_peak + (FSR_secondary * (num_peaks - 1) / 2), num_peaks)
        valley_indices = argrelextrema(filtered_power_data_linear, np.less)[0]
        threshold = np.max(filtered_power_data_linear) * 0.5
        filtered_valley_indices = [idx for idx in valley_indices if filtered_power_data_linear[idx] < threshold]
        plt.plot(filtered_wavelength, filtered_power_data_linear, label=f'Element #{plot_id}')
        plt.plot(filtered_wavelength[filtered_valley_indices], filtered_power_data_linear[filtered_valley_indices], "o", markersize=5)
        for peak in peaks_principal:
            plt.axvline(x=peak, color='r', linestyle='--')
            #max_power = np.max(filtered_power_data_linear)
           # min_power = np.min(filtered_power_data_linear)
           # text_offset = min_power * 0.1  # Adjust this factor as needed
         # plt.text(peak, min_power + text_offset, f'{FSR_principal:.2f} nm', rotation=90, verticalalignment='bottom', horizontalalignment='right', color='r')
        for peak in peaks_secondary:
            plt.axvline(x=peak, color='b', linestyle='--')
          #  min_power = np.min(filtered_power_data_linear)
           # text_offset = min_power * 0.02  # Adjust this factor as needed
            #plt.text(peak, min_power + text_offset, f'{FSR_secondary:.2f} nm', rotation=90, verticalalignment='bottom', horizontalalignment='right', color='b')
        plt.title(f'Analysing Power Measurements for Wavelengths between 1545nm to 1555nm\n for element #{plot_id}')
        plt.xlabel('Wavelength (nm)')
        plt.ylabel('Power (mW)')
        plt.grid(True)
        plt.legend()
        plt.tight_layout()
        plt.show()

