for peak in peaks_principal:
    plt.axvline(x=peak, color='r', linestyle='--')
for peak in peaks_secondary:
    plt.axvline(x=peak, color='b', linestyle='--')
plt.axhline(y=threshold, color='g', linestyle='--', label='Threshold')
plt.plot(filtered_wavelength[filtered_valley_indices], filtered_power_data_linear[filtered_valley_indices], "o", color='b', markersize=10, label='Filtered Peaks')
