"""Calculating the phase reponse $\Phi = \text{arctan}(\frac{\text{Im}(t)}{\text{Re}(t)})$"""

#Coupling regimes
eta1 = [.01,0.10,.08]
ph = 0#np.pi/2
phi  = np.linspace(-np.pi,np.pi,100) + ph
zeta = 0.92
for eta in eta1:
  if eta == np.round(1.0-zeta, decimals = 2):
    phip = np.arctan(np.sin(phi)/(1-np.cos(phi))) - np.arctan(np.sqrt(zeta)*np.sin(phi)/(1-np.sqrt(zeta)*np.cos(phi)))
    plt.plot(phi/np.pi,phip/np.pi, label = f'Critically-Coupled; $\eta$: {eta}')
  elif eta < 1- zeta:
    phip = np.arctan(np.sqrt(zeta)*np.sin(phi)/(np.sqrt(1-eta) - np.sqrt(zeta)*np.cos(phi))) - np.arctan(np.sqrt(1-eta)*np.sqrt(zeta)*np.sin(phi)/(1-np.sqrt(1-eta)*np.sqrt(zeta)*np.cos(phi)))
    plt.plot(phi/np.pi,phip/np.pi, label = f'Under-Coupled; $\eta$: {eta}')
  elif eta > 1-zeta:
    phip = np.pi - phi - np.arctan(np.sqrt(1-eta)*np.sqrt(zeta)*np.sin(phi)/(1-np.sqrt(1-eta)*np.sqrt(zeta)*np.cos(phi)))
    plt.plot(phi/np.pi,phip/np.pi, label = f'Over-Coupled; $\eta$: {eta}')
plt.legend()
plt.xlabel('$\phi/\pi$')
plt.ylabel('Phase response/$\pi$')
plt.title('Coupling regimes for $\zeta$ = '  f'{zeta}')
plt.show()

