import numpy as np
import matplotlib.pyplot as plt

# Coupling regimes
eta1 = [0.01, 0.20, 0.08]
ph = 0#np.pi / 2
phi = np.linspace(-np.pi, np.pi, 10000) + ph
zeta = 0.92

plt.figure(figsize=(10, 5))

for eta in eta1:
    # Calculate the transfer function T(phi)
    if eta == np.round(1.0 - zeta, decimals=2):
      T_phi = (np.sqrt(1-eta) - np.sqrt(zeta) * np.exp(-1j * phi)) / (1 - np.sqrt(1-eta) *np.sqrt(zeta) * np.exp(-1j * phi))
      # Calculate the intensity
      intensity = np.abs(T_phi) ** 2
      # Normalize the intensity
      normalized_intensity = intensity / np.max(intensity)
      plt.plot(phi/np.pi, normalized_intensity, label=f'Critically-Coupled; $\\eta$: {eta}')
    elif eta < 1 - zeta:
      T_phi = (np.sqrt(1-eta) - np.sqrt(zeta) * np.exp(-1j * phi)) / (1 - np.sqrt(1-eta) *np.sqrt(zeta) * np.exp(-1j * phi))
      # Calculate the intensity
      intensity = np.abs(T_phi) ** 2
      # Normalize the intensity
      normalized_intensity = intensity / np.max(intensity)
      plt.plot(phi/np.pi, normalized_intensity, label=f'Under-Coupled; $\\eta$: {eta}')
    elif eta > 1- zeta:
      T_phi = (np.sqrt(1-eta) - np.sqrt(zeta) * np.exp(-1j * phi)) / (1 - np.sqrt(1-eta) *np.sqrt(zeta) * np.exp(-1j * phi))
      # Calculate the intensity
      intensity = np.abs(T_phi) ** 2
      # Normalize the intensity
      normalized_intensity = intensity / np.max(intensity)
      plt.plot(phi/np.pi, normalized_intensity, label=f'Over-Coupled; $\\eta$: {eta}')

    # Plot the normalized intensity


plt.legend()
plt.xlabel('$\phi/\pi$')
plt.ylabel('Normalized Intensity Transmission $T(\\phi)$')
plt.title(f'Normalized Intensity Response for $\\zeta$ = {zeta}')
plt.show()

