import numpy as np
import matplotlib.pyplot as plt
from scipy.optimize import curve_fit
from scipy.special import wofz

# Constants and parameters
lmda = np.linspace(1530e-9, 1531e-9, 10000)
c = 3 * 10**8
eta = 0.03
zeta = 0.92
omega = 2 * np.pi * c / lmda
n = 2
r = 114e-6  # m
L = 2 * np.pi * r
T = n * L / c
phi = omega * T
T_phi = (np.sqrt(1 - eta) - np.sqrt(zeta) * np.exp(-1j * phi)) / (1 - np.sqrt(1 - eta) * np.sqrt(zeta) * np.exp(-1j * phi))
intensity = np.abs(T_phi) ** 2

# Normalize the intensity
normalized_intensity = intensity / np.max(intensity)

# Voigt profile function
def voigt(x, A, x0, sigma, gamma):
    z = ((x - x0) + 1j * gamma) / (sigma * np.sqrt(2))
    return 1 - A * np.real(wofz(z)) / (sigma * np.sqrt(2 * np.pi))

# Initial guesses
initial_guess = [1, lmda[np.argmin(normalized_intensity)], (lmda[-1] - lmda[0]) / 100, (lmda[-1] - lmda[0]) / 100]

# Fit the Voigt profile to the data
popt, _ = curve_fit(voigt, lmda, normalized_intensity, p0=initial_guess, maxfev=2000)

# Extract fitted parameters
A_fit, x0_fit, sigma_fit, gamma_fit = popt
FWHM_gaussian = 2.355 * sigma_fit
FWHM_lorentzian = 2 * gamma_fit
FWHM_voigt = 0.5346 * FWHM_lorentzian + np.sqrt(0.2166 * FWHM_lorentzian**2 + FWHM_gaussian**2)

print(f'FWHM (Voigt fit): {FWHM_voigt * 1e9:.3f} nm')

# Plot
plt.plot(lmda * 1e9, normalized_intensity, label='Normalized Intensity')
plt.plot(lmda * 1e9, voigt(lmda, *popt), 'r--', label='Voigt Fit')
plt.xlabel('Wavelength (nm)')
plt.ylabel('Normalized Intensity Transmission $T(\\lambda)$')
plt.title(f'Normalized Intensity Response for $\\zeta$ = {zeta}, $\\eta$ = {eta}')
plt.legend()
plt.show()

